import React from 'react';
import { motion } from 'framer-motion';
import './Hero.css';
import './ButtonStyles.css';

const Hero = () => {
  return (
    <motion.section 
      className="hero"
      initial={{ opacity: 0 }}
      whileInView={{ opacity: 1 }}
      transition={{ duration: 1 }}
      viewport={{ once: true }}
    >
      <div className="hero-container">
        {/* Hero Header */}
        <motion.div 
          className="hero-header"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.2 }}
          viewport={{ once: true }}
        >
          <div className="hero-logo">
            <img src="/whale-shark-logo.svg" alt="WhaleShark Logo" />
          </div>
          <h2>WHALESHARK</h2>
          <p style={{
            fontSize: '1.5rem',
            fontWeight: '700',
            color: '#ffffff',
            marginBottom: '2rem',
            fontFamily: "'Inter', sans-serif",
            background: 'linear-gradient(45deg, #00d4ff, #ff6b9d, #8b5cf6)',
            backgroundSize: '200% 200%',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            backgroundClip: 'text',
            animation: 'gradientShift 3s ease-in-out infinite'
          }}>The Ocean's Most Powerful Meme Coin</p>
        </motion.div>


        {/* Hero Description Card */}
        <motion.div 
          className="hero-description-card"
          style={{
            border: '3px solid #00ffff',
            background: 'rgba(0, 255, 255, 0.1)',
            boxShadow: '0 0 20px rgba(0, 255, 255, 0.3)',
            transform: 'scale(1.01)',
            borderRadius: '12px'
          }}
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.4 }}
          viewport={{ once: true }}
        >
          <div className="hero-description">
            <p>Dive deep into the crypto ocean with $whaleshark - launching on Pump.fun!</p>
            <p>Our friendly $whaleshark is ready to devour the competition and graduate to CEX exchanges.</p>
            <p>Join the pod early and ride the wave to the moon!</p>
          </div>
        </motion.div>

        {/* Hero Philosophy Section */}
        <motion.div 
          className="hero-philosophy-section"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.6 }}
          viewport={{ once: true }}
        >
          <h3>🎯 Why $whaleshark Will Moon</h3>
          <div className="philosophy-grid">
            <motion.div
              className="philosophy-item"
              style={{
                border: '3px solid #00ffff',
                background: 'rgba(0, 255, 255, 0.1)',
                boxShadow: '0 0 20px rgba(0, 255, 255, 0.3)',
                transform: 'scale(1.02)',
                borderRadius: '12px'
              }}
              initial={{ opacity: 0, scale: 0.9 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.6, delay: 0.6 }}
              viewport={{ once: true }}
              whileHover={{ scale: 1.05 }}
            >
              <div className="philosophy-icon" style={{ 
                color: '#00ffff',
                textShadow: '0 0 10px rgba(0, 255, 255, 0.5)',
                fontSize: '2rem'
              }}>🏊</div>
              <p style={{ 
                color: '#ffffff',
                textShadow: '0 0 8px rgba(0, 255, 255, 0.4)',
                fontWeight: 'bold'
              }}>Swimming through the crypto markets with precision and power</p>
            </motion.div>
            <motion.div
              className="philosophy-item"
              style={{
                border: '3px solid #00ffff',
                background: 'rgba(0, 255, 255, 0.1)',
                boxShadow: '0 0 20px rgba(0, 255, 255, 0.3)',
                transform: 'scale(1.02)',
                borderRadius: '12px'
              }}
              initial={{ opacity: 0, scale: 0.9 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.6, delay: 0.7 }}
              viewport={{ once: true }}
              whileHover={{ scale: 1.05 }}
            >
              <div className="philosophy-icon" style={{ 
                color: '#00ffff',
                textShadow: '0 0 10px rgba(0, 255, 255, 0.5)',
                fontSize: '2rem'
              }}>🦈</div>
              <p style={{ 
                color: '#ffffff',
                textShadow: '0 0 8px rgba(0, 255, 255, 0.4)',
                fontWeight: 'bold'
              }}>Devouring weak hands and market volatility with strategic moves</p>
            </motion.div>
            <motion.div
              className="philosophy-item"
              style={{
                border: '3px solid #00ffff',
                background: 'rgba(0, 255, 255, 0.1)',
                boxShadow: '0 0 20px rgba(0, 255, 255, 0.3)',
                transform: 'scale(1.02)',
                borderRadius: '12px'
              }}
              initial={{ opacity: 0, scale: 0.9 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.6, delay: 0.8 }}
              viewport={{ once: true }}
              whileHover={{ scale: 1.05 }}
            >
              <div className="philosophy-icon" style={{ 
                color: '#00ffff',
                textShadow: '0 0 10px rgba(0, 255, 255, 0.5)',
                fontSize: '2rem'
              }}>🌙</div>
              <p style={{ 
                color: '#ffffff',
                textShadow: '0 0 8px rgba(0, 255, 255, 0.4)',
                fontWeight: 'bold'
              }}>Ready to moon with our dedicated community and strong fundamentals</p>
            </motion.div>
          </div>
        </motion.div>

        {/* Action Buttons */}
        <motion.div 
          className="hero-buttons"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 1 }}
          viewport={{ once: true }}
        >
          <motion.a
            href="https://x.com/whaleshark_coin?s=21"
            target="_blank"
            rel="noopener noreferrer"
            className="btn btn-secondary btn-follow-x"
            style={{ lineHeight: '1.6' }}
            whileHover={{
              scale: 1.05,
              y: -5,
              boxShadow: "0 0 30px rgba(255, 0, 255, 0.6), 0 0 60px rgba(255, 0, 255, 0.3), 0 0 100px rgba(0, 255, 255, 0.4)"
            }}
            whileTap={{ scale: 0.95 }}
            transition={{ type: "spring", stiffness: 300, damping: 20 }}
          >
            FOLLOW ON X
          </motion.a>
          <motion.a
            href="https://pump.fun"
            target="_blank"
            rel="noopener noreferrer"
            className="btn btn-secondary"
            whileHover={{
              scale: 1.05,
              y: -5,
              boxShadow: "0 0 30px rgba(255, 0, 255, 0.6), 0 0 60px rgba(255, 0, 255, 0.3), 0 0 100px rgba(0, 255, 255, 0.4)"
            }}
            whileTap={{ scale: 0.95 }}
            transition={{ type: "spring", stiffness: 300, damping: 20 }}
          >
            🚀 BUY NOW
          </motion.a>
          <motion.a 
            href="https://dexscreener.com" 
            target="_blank" 
            rel="noopener noreferrer" 
            className="btn btn-secondary btn-dexscreener"
            whileHover={{
              scale: 1.05,
              y: -5,
              boxShadow: "0 0 30px rgba(255, 0, 255, 0.6), 0 0 60px rgba(255, 0, 255, 0.3), 0 0 100px rgba(0, 255, 255, 0.4)"
            }}
            whileTap={{ scale: 0.95 }}
            transition={{ type: "spring", stiffness: 300, damping: 20 }}
          >
            📊 DEXSCREENER
          </motion.a>
          <motion.a
            href="https://t.me/whaleshark_coin"
            target="_blank"
            rel="noopener noreferrer"
            className="btn btn-secondary btn-telegram"
            whileHover={{
              scale: 1.05,
              y: -5,
              boxShadow: "0 0 30px rgba(255, 0, 255, 0.6), 0 0 60px rgba(255, 0, 255, 0.3), 0 0 100px rgba(0, 255, 255, 0.4)"
            }}
            whileTap={{ scale: 0.95 }}
            transition={{ type: "spring", stiffness: 300, damping: 20 }}
          >
            JOIN ON TELEGRAM
          </motion.a>
        </motion.div>
      </div>
    </motion.section>
  );
};

export default Hero;
